import java.util.ArrayList;
import java.util.Arrays;
import java.util.List;

public class lc_find_all_anagrams_in_a_string {
    /*
     * This is the brute force solution to find all anagrams of a string p in string s.
     * The time complexity of this solution is O((n-m+1) * m log
     */
     public static List<Integer> findAnagrams(String s, String p) {
        List<Integer> result = new ArrayList<>();
        List<String> subArrays = new ArrayList<>();
        char [] pArray = p.toCharArray();
        Arrays.sort(pArray);
        for(int i = 0 ; i <= s.length() - p.length() ; i++){
            String sub = s.substring(i, i+p.length());
            subArrays.add(sub);
        }
    for (int i = 0 ; i<= subArrays.size()-1 ; i++){
        char[] current = subArrays.get(i).toCharArray();
        Arrays.sort(current);
        if(Arrays.equals(current, pArray)){
            result.add(i);
        }
    }
    return result;
    }
    public static List<Integer> findAnagramsOpt(String s, String p) {
        List<Integer> result = new ArrayList<>();
        int n = s.length();
        int k = p.length();
        if (k > n) {
            return result;
        }
        int[] pCount = new int[26];
        int[] sCount = new int[26];

        for (int i = 0; i < k; i++) {
            pCount[p.charAt(i) - 'a']++;
            sCount[s.charAt(i) - 'a']++;
        }
        if (Arrays.equals(pCount, sCount)) {
            result.add(0); 
        }
        for (int right = k; right < n; right++) {
            sCount[s.charAt(right) - 'a']++;
            int left = right - k;
            sCount[s.charAt(left) - 'a']--;
            if (Arrays.equals(pCount, sCount)) {
                result.add(left + 1); 
            }
        }

        return result;
    }
    public static void main(String[] args) {
       System.out.println( findAnagrams("", "yqrbgjdwtcaxzsnifvhmou"));
           System.out.println( findAnagramsOpt("", "yqrbgjdwtcaxzsnifvhmou"));

    }

}